import React, { Component } from "react";
import "./navbar.css";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div id="wrapper">
        <div id="title">
          <span>Receiply</span>
        </div>
        <div>
          <div class="navitem" id="login">
            <span>Login</span>
          </div>
          <div class="navitem" id="signup">
            <span>Sign up</span>
          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
